import { StatusBar } from 'expo-status-bar';
import React from 'react';
import { StyleSheet, Text, View, Button, PointPropType, Image, TouchableOpacity, FlatList, ScrollView } from 'react-native';
import { AntDesign } from '@expo/vector-icons';
import { Feather } from '@expo/vector-icons';
import { Ionicons } from '@expo/vector-icons';
import { FontAwesome } from '@expo/vector-icons';
import { createNativeStackNavigator } from '@react-navigation/native-stack';
export default function trangchu({ navigation }) {
    return (
        <View atyle={styles.container}>


            <Text style={styles.text}> Danh Mục Sản Phẩm</Text>
            
            

            

        </View>
    );
}
const Stack = createNativeStackNavigator();

const styles = StyleSheet.create({
    container: {
        flex: 1,
        backgroundColor: '#fff',
        alignItems: 'center',
    },

    text: {
        marginTop: 10,
        fontSize: 24,
        fontWeight: 'bold',
        color: '#635555',
        marginLeft: 5,
    },

    bottom: {
        width: 400,
        backgroundColor: 'white',
        height: 60,
        flexDirection: 'row',
        marginTop: -90,
    },
    icon3: {
        marginTop: -150,
        marginLeft: 120,
    },
    bottom1: {
        marginLeft: 55,
        marginTop: 5,
    },
    bottom2: {
        marginLeft: 15,
        marginTop: 5,
    },
    chubottom: {
        flexDirection: 'row',
        marginTop: -30,
    },
    chubottom1: {
        marginLeft: 1,
        marginTop: 2,
    },
    chubottom2: {
        marginLeft: 20,
        marginTop: 2,
    },
    chubottom3: {
        marginLeft: 27,
        marginTop: 2,
    },
    chubottom4: {
        marginLeft: 25,
        marginTop: 2,
    },
    chubottom5: {
        marginLeft: 33,
        marginTop: 2,
    },
    hinhanh5: {
        width: 100,
        height: 100,
        borderRadius: 50,
    },
    hang1: {
        flexDirection: 'row',
        marginTop: 10,
        width: 200,
    },
    hang2: {
        flexDirection: 'row',
        marginTop: 15,
        width: 200,
    },
    hang3: {
        flexDirection: 'row',
        marginTop: 15,
        width: 200,
    },
    textchung: {
        marginTop: 25,
        marginLeft: 25,
        fontSize: 15,
    },
    textgia: {
        color: 'red',
        fontSize: 16,
        marginLeft: 130,
        marginTop: -35,
        fontWeight: 'bold',
    },
    iconxin: {
        flexDirection: 'row',
        marginLeft: 130,
        marginTop: -10,
    },
    cachicon: {
        paddingRight: 20,
    },

    button: {
        width: 155,
        height: 40,
        backgroundColor: '#DE4547',
        borderRadius: 45,
        marginTop: -20,
        marginLeft: 15,
    },
    icon3: {
        marginLeft: 125,
        marginTop: -29,
    },
});
